import React from "react";
import "../../App.css";
import Footer from "../Footer";

import { Link } from "react-router-dom";
import ScrollToTop from "react-scroll-up";

function Manualpullstation() {
  return (
    <div className="area">
      <div className="container">
        <div className="grid">
          <div className="item">
            {/* ชุดที่1 */}
            <div className="img">
              <img
                className="data-img"
                src="/img-v1/Manualpullstation-1.png"
                alt="control "
              />
              <div className="data-text">
                <h3>FireWatcher 721 Manual Pull Station FW721</h3>
                <br />
                <p>
                  <li></li>
                  <li></li>
                  <li></li>
                </p>

                <div className="btn">
                  <Link to="/products">
                    <button className="btn-1">อุปกรณ์ทั้งหมด </button>
                  </Link>
                </div>
              </div>
            </div>
            {/* ชุดที่ 2 */}
            <div className="img">
              <img
                className="data-img"
                src="/img-v1/Manualpullstation-2.png"
                alt="control "
              />
              <div className="data-text">
                <h3>FireWatcher 722 Manual Pull Station FW722</h3>
                <br />
                <p>
                  <li></li>
                  <li></li>
                  <li></li>
                </p>

                <div className="btn">
                  <Link to="/products">
                    <button className="btn-1">อุปกรณ์ทั้งหมด </button>
                  </Link>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
      <ScrollToTop showUnder={160}>
        <span>
          <img src="/img-960px/up_arrow_round.png" alt="" />
        </span>
      </ScrollToTop>
      <Footer />
    </div>
  );
}

export default Manualpullstation;
